import React from 'react';
import './App.css';

function App() {
  const companyName = 'Bugslink Technology';
  const contactInfo = {
    firstName: 'Hafiz',
    lastName: 'Abdullah',
    email: 'hafizabdullah7022@gmail.com',
    phoneNumber: '+923064607395',
  };
  const companyAddress = 'House 12, Street 17 Area Landhi,Karachi, 75790, Pakistan ';

  return (
    <div className="App">
      <div className="header">
        <h1>{companyName}</h1>
      </div>
      <div className="contact-info">
        <div className="profile">
          <img src="your-profile-picture-url" alt="Profile" />
          <div className="name">
            <h2>{contactInfo.firstName} {contactInfo.lastName}</h2>
          </div>
        </div>
        <div className="details">
          <h3>Email: {contactInfo.email}</h3>
          <h3>Phone: {contactInfo.phoneNumber}</h3>
        </div>
      </div>
      <div className="address">
        <h2>Address:</h2>
        <p>{companyAddress}</p>
      </div>
    </div>
  );
}

export default App;
